$(function () {
    $("#pdf").click(function () {
        var style = $(".card-main-div").attr("style");
        var result = p = /\(([^()]+)\)/g.exec(style);
        var url = result[1].substr(1, result[1].length - 2);
        var dataUrl;
        if (url == "/public/images/andrej-lisakov-679177-unsplash.jpg")
            dataUrl = "data:image/jpeg;base64,";
        if (url == "/public/images/annie-spratt-469221-unsplash.jpg") {
            dataUrl = "data:image/jpeg;base64,";
        }
        if (url == "/public/images/bogomil-mihaylov-768373-unsplash.jpg")
            dataUrl = "data:image/jpeg;base64,";
        if (url == "/public/images/nordwood-themes-162462-unsplash.jpg")
            dataUrl = "data:image/jpeg;base64,";
        var doc = new jsPDF();
        var width = doc.internal.pageSize.getWidth();
        var height = doc.internal.pageSize.getHeight();
        doc.addImage(dataUrl, "JPEG", 0, 0, width, height);
        var text1 = $("span[class='edit-custom-generic edit-custom-text1']").text();
        var text2 = $("span[class='edit-custom-generic edit-custom-text2']").text();
        var text3 = $("span[class='edit-custom-generic edit-custom-text3']").text();
        var text4 = $("span[class='edit-custom-generic edit-custom-text4']").text();
        var color = $("span[class='edit-custom-generic edit-custom-text1']").attr("style");
        result = p = /\(([^()]+)\)/g.exec(color);
        var c = result[1].replace(/[^\d,]/g, '');
        c = c.split(",");
        var font = $("span[class='edit-custom-generic edit-custom-text4']").css("font-size");
        doc.setFontSize(font.substring(0, 2));
        doc.setTextColor(c[0], c[1], c[2]);
        doc.text(30, 50, text1);
        doc.text(30, 120, text2);
        doc.text(30, 190, text3);
        doc.text(30, 260, text4);
        doc.save('flyer.pdf');
    });

});
